function initCustomTabs(){document.querySelectorAll(".custom-tabs-bar").forEach((t=>{const e=t.querySelectorAll(".custom-tabs-btn");e.forEach((t=>t.addEventListener("click",(()=>handleTabClick(t))))),e.length&&handleTabClick(e[0])}))}function handleTabClick(t){const e=t.parentElement,o=t.getAttribute("aria-custom-tabs-tab");e.querySelectorAll(".custom-tabs-btn").forEach((t=>{t.classList.remove("custom-tabs-btn-active"),document.getElementById(t.getAttribute("aria-custom-tabs-tab"))?.style.setProperty("display","none")})),t.classList.add("custom-tabs-btn-active"),document.getElementById(o)?.style.setProperty("display","block")}class FootNote extends HTMLElement{static count=0;static footnotes={};static externalLinks={};connectedCallback(){const t=this.getAttribute("href");if(!(t in FootNote.footnotes)){FootNote.footnotes[t]=++FootNote.count;try{document.querySelector(t)?.insertAdjacentHTML("afterbegin",`<sup>[${FootNote.footnotes[t]}]</sup>`)}catch{FootNote.externalLinks[t]=!0}}this.innerHTML=`<sup><a href="${t}" ${FootNote.externalLinks[t]?'target="_blank"':""}>[${FootNote.footnotes[t]}]</a></sup>`}}function enableClipboardCopy(){document.querySelectorAll("[ctc]").forEach((t=>{t.setAttribute("tabindex","0"),t.addEventListener("click",(t=>{t.preventDefault(),navigator.clipboard.writeText(t.target.innerText)}))}))}document.addEventListener("DOMContentLoaded",(()=>{enableClipboardCopy(),customElements.define("foot-note",FootNote),initCustomTabs()}));